import { getAllEvent } from "../../../Api/CommunityApi/CommunityApi";

export function Home() {
  const [eventData, setEventData] = useState([]);

  useEffect(() => {
    getEvent();
  });

  async function getEvent() {
    const eventAxios = await getAllEvent();
    setEventData(eventAxios);
  }
  return (
    <>
      <h1>강의 정보를 제공하는 웹페이지입니다.</h1>
    </>
  );
}
